import React from "react";
import "./App.css";
import { Control } from "./components/control";

import { library } from "@fortawesome/fontawesome-svg-core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHome,
  faCode,
  faUser,
  faBriefcase,
  faNewspaper,
  faEnvelopeOpen,
  faR,
  fas,
} from "@fortawesome/free-solid-svg-icons";
import { faGithub } from "@fortawesome/free-brands-svg-icons";

function App() {
  return (
    <div className="App">
      <body className="main-content">
        <header className="section sec1 ehader active"></header>
        <main>
          <section className="section sec2 about"></section>
          <section className="section sec3 portfolio"></section>
          <section className="section sec4 blogs"></section>
          <section className="section sec5 contacts"></section>
        </main>

        <div className="controls">
          <div className="control control-1 active-btn">
            <FontAwesomeIcon icon={faHome} />
          </div>

          <Control buttonIcon={faHome} positionOfControlButton="control-1" data_idName="header" activeButton={true}/>

          <Control buttonIcon={faUser} positionOfControlButton="control-2" data_idName="about" activeButton={false}/>

          <Control buttonIcon={faBriefcase} positionOfControlButton="control-3" data_idName="portfolio" activeButton={false}/>

          <Control buttonIcon={faNewspaper} positionOfControlButton="control-4" data_idName="blogs" activeButton={false}/>

          <Control buttonIcon={faEnvelopeOpen} positionOfControlButton="control-5" data_idName="contact" activeButton={false}/>
        </div>
      </body>
    </div>
  );
}

export default App;
